import React from 'react';

import TableItemCell from './TableItemCell';
import { isBig } from '../utils/otherUtils';
import ButtonDiv from './UI/ButtonDiv/ButtonDiv';
import { modalPropetiesType } from '../types/modalType';

interface TableItemProps {
  typeTable: string,
  cells: any[],
  addButtons? : boolean,
  idNote: number,
  modalProperties: modalPropetiesType,
  setModalProperties: Function
}

const TableItem: React.FC<TableItemProps> = ({
  typeTable,
  cells,
  addButtons,
  idNote,
  modalProperties,
  setModalProperties
}) => {

  const cl = 'notesTableRow ' + typeTable;
  const addBigItem = cells.length > 3;

  return (
    <div className={cl}>
        {cells.map((cell, index) => 
          addBigItem ? 
          <TableItemCell haveBigItem = {isBig(index)} key={index}>{cell}</TableItemCell> :
          <TableItemCell key={index}>{cell}</TableItemCell>
        )}
        
        {addButtons ? <ButtonDiv 
                          modalProperties={modalProperties} idNote={idNote} type={typeTable} setModalProperties={setModalProperties}/> 
                          : ''}
    </div>
  );

}
  
  
export default TableItem;
